import React, { useEffect, useState } from "react";

import { DataGrid } from '@mui/x-data-grid';

import { useNavigate } from 'react-router-dom'
import axios from "axios";

const columns = [
  {
    field: 'id',
    headerName: 'ID',
    width: 90,
  },
  { field: 'fristName', headerName: 'FristName', width: 130 },
  { field: 'lastName', headerName: 'LastName', width: 130 },
  { field: 'age', headerName: 'Age', width: 130 },
  {
    field: 'email',
    headerName: 'email',
    width: 90,
  },
  {
    field: 'address',
    headerName: 'address',
    width: 160,
  }
];

function Home() {

  const navigate = useNavigate()

  const [users, setUsers] = useState([])

  useEffect(() => {
    const dataRegister = JSON.parse(localStorage.getItem("dataRegister"))
    if (!dataRegister) {
      navigate('/register')
    }
    const res = axios.get("https://649cf38a9bac4a8e669d1b36.mockapi.io/todolist")
    res.then((data) => setUsers(data.data))
  }, [])

  return (
    <div style={{ height: 400, width: '100%' }}>
      <DataGrid
        rows={users}
        columns={columns}
        initialState={{
          pagination: {
            paginationModel: { page: 0, pageSize: 5 },
          },
        }}
        pageSizeOptions={[5, 10]}
        checkboxSelection
      />
    </div>
  );

}

export default Home;
